// SPDX-License-Identifier: MIT
pragma solidity ^0.8.15;

contract FunctionModifier{

    uint public count;
    bool public paused;


    modifier notPause(){
        require (paused, "Paused");
        _;
    }
    function inc() public notPause{
        count+=1;
    }
    function dec() public notPause{
        count-=1;
    }
}

